import logo from './logo.svg';
import './App.css';
import './logica.js';

function App() {



            return (
              <div className="App">
                <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />

                  <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Mi primera app en react js
                  </a>
                </header>
              </div>
            );
}

export default App;
